window.jsData("5c6449c5-1c32-4e3d-ba17-35fc2cdc1271", [{"start":{"type":"kTopicStart","text":"// kTopicStart","params":{},"lineIndex":0},"content":"#include<stdio.h>\n\nint add(int x, int y); // prototype, we can put this in head file\nint add3(int x, int y, int z);\n\nint add(int x, int y) { // definition\n    return x  + y;\n}\n\nint add3(int x, int y, int z) {\n    return add(add(x, y),z);\n}\n\n/**\n *\n * functions\n */\nint main(void) {\n    printf(\"add 3 and 4: %d\\n\", add(3, 4));\n    printf(\"add 3, 4 and 5: %d\\n\", add3(3, 4, 5));\n}","end":{"type":"kTopicEnd","text":"// kTopicEnd","params":{},"lineIndex":25},"description":"<p>function prototypes and function definition</p>\n","format":"c","console":"add 3 and 4: 7\nadd 3, 4 and 5: 12\n"}]);